import Days from "../days/Days"
import "./calendar.css"

export default function Calendar() {
    const weekdays = ['Sun', 'Mon', 'Tues', 'Wed', 'Thurs', 'Fri', 'Sat'];
    return (
        <div className="calendar">
        {weekdays.map(weekday => {
            <span key={weekday} className="weekday">{weekday}</span>
        })}
            <Days></Days>
        </div>
    )
}
